import React from "react";
import { Checkbox, CheckboxGroup } from "@chakra-ui/react";

export const CheckList = ({ tasks }) => {
  return (
    <div>
      {tasks.map((task) => (
        <Checkbox default IsUnchecked>
          {task}
        </Checkbox>
      ))}
    </div>
  );
};
